firstComment:
🚨
@samsungindia – Extremely Disappointed!

I’ve been dealing with an unresolved repair issue (Service Request Number: 4402695666) for my Samsung washing machine, and the experience has been beyond frustrating. I paid around ₹5500 to the service center for this repair, and they assured me that the required spare parts were ordered and that the repair would be completed within 4 days. Yet, no one has shown up to fix the issue. To make matters worse, Samsung has updated the repair status to “completed” – which is completely false!

This is not just a lack of service; it feels like outright fraud. I trusted Samsung to be reliable, but this experience has been anything but.

@samsungindia , it’s time to step up, take responsibility, and resolve this issue immediately.

#samsungindia #poorservice #UnresolvedRepair #frustratedcustomer #samsungsupport

